package java0511_collection_myexam;

public class Excel {
	String menu;
	String store;
	int price;
	int amount;
	
	public Excel() {
		// TODO Auto-generated constructor stub
	}

	public Excel(String menu, String store, int price, int amount) {
		super();
		this.menu = menu;
		this.store = store;
		this.price = price;
		this.amount = amount;
	}

	public String getMenu() {
		return menu;
	}

	public void setMenu(String menu) {
		this.menu = menu;
	}

	public String getStore() {
		return store;
	}

	public void setStore(String store) {
		this.store = store;
	}

	public int getPrice() {
		return price;
	}

	public void setPrice(int price) {
		this.price = price;
	}

	public int getAmount() {
		return amount;
	}

	public void setAmount(int amount) {
		this.amount = amount;
	}
	
	
	
	
}
